// Keep your original unpause behavior
onload = () => {
  document.body.classList.remove("container"); // resumes lilies animation
};

// ===== Show message overlay AFTER lilies animate =====
(function () {
  const LILIES_INTRO_MS = 5000; // wait 5s before showing messages (adjust as you like)

  // Elements
  const overlay = document.querySelector('.love-overlay');
  const step1 = document.getElementById('step1');
  const step2 = document.getElementById('step2');
  const yesBtn = document.getElementById('yes');
  const noBtn  = document.getElementById('no');

  // Popup
  const popup = document.getElementById('popup');
  const popupImg = document.getElementById('popup-img');
  const popupCaption = document.getElementById('popup-caption');

  // Use your existing base64 YES image & caption if you had them
  const IMG_YES = "data:image/jpeg;base64,";
  const CAPTION_YES = "yeheyyy! thank you so much, mahal!";

  const IMG_NO = "data:image/jpeg;base64,";
  const CAPTION_NO = "asdfghjkl what...???";

  // After lilies intro, reveal overlay and Step 1
  window.addEventListener('load', () => {
    setTimeout(() => {
      if (overlay) overlay.classList.add('visible');
      if (step1) {
        step1.classList.add('show');
        // Move to Step 2 a moment later
        setTimeout(() => {
          step1.classList.remove('show');
          if (step2) step2.classList.add('show');
        }, 2200);
      }
    }, LILIES_INTRO_MS);
  });

  // YES  popup with image + caption
  if (yesBtn) {
    yesBtn.addEventListener('click', () => {
      if (!popup) return;
      popup.classList.add('show');
      if (IMG_YES) popupImg.src = IMG_YES;
      popupCaption.textContent = CAPTION_YES;
    });
  }

  // NO  playful nudge (optional) or also show popup
  if (noBtn) {
    noBtn.addEventListener('mouseenter', () => {
      const dx = (Math.random() * 80 - 40);
      const dy = (Math.random() * 50 - 25);
      noBtn.style.transform = `translate(${dx}px, ${dy}px)`;
    });
    noBtn.addEventListener('mouseleave', () => {
      noBtn.style.transform = 'translate(0, 0)';
    });
    noBtn.addEventListener('click', () => {
    if (!popup) return;
    popup.classList.add('show');
    if (IMG_NO) popupImg.src = IMG_NO;       // show NO image
    popupCaption.textContent = CAPTION_NO;   // show NO caption
  });
  }

  // Close popup by clicking the dark backdrop
  if (popup) {
    popup.addEventListener('click', () => {
      popup.classList.remove('show');
    });
  }
})();
